INSERT INTO `loan` (`loanID`, `name`, `bankID`, `rqmntsbasic`, `rqmntdoc`, `rate`) VALUES
(1, 'Personal Loan', 1, 'Filipino citizen or foreigner residing in the Philippines for more than two (2) years\r\nMust be 21 years old at time of application but no more than 70 years old upon maturity\r\nMinimum Gross Annual income\r\nP120,000 for Salaried Employees\r\nP400,000 for  Self-Employed / Professionals\r\nMust have a mobile phone and at least 1 landline phone at either residence or office\r\nResidence or office must be within BDO serviceable area\r\nAdditional application requirement for Salaried Employees\r\nMust be at least one (1)  year tenure with the company\r\nAdditional application requirement for Self-Employed\r\nMust be a sole proprietor or majority part-owner of a company operating for at least two (2) years.\r\nAdditional application requirement for Professionals\r\nMust be in private practice for at least one (1) year', 'Pre Approval\r\n\r\nProof of Income for Salaried Employees\r\n\r\nPhotocopy of the latest BIR Form 2316 or W2 signed by employer''s authorized representative (MANDATORY) and submit any of the following:\r\nOriginal Certificate of Employment and Income (COEI) issued in the last three (3) months indicating status, length of service and breakdown of compensation\r\nPhotocopy of last full month pay slip\r\nProof of Income for Self-Employed/Professionals\r\n\r\nPhotocopy of Registration of Business Name\r\nFor Single Proprietorship issued by the DTI (Department of Trade and Industry)\r\nFor Partnerships issued by the SEC (Securities and Exchange Commission)\r\nPhotocopy of latest ITR and W4 with BIR/Bank Stamp (MANDATORY)\r\nPhotocopy of latest Audited Financial Statements for the last two (2) years\r\nPhotocopy of Bank Statements for the last six (6) months (OPTIONAL)\r\nProof of Identification - Photocopy of at least two (2) valid photo-bearing identification documents, front and back, issued and signed by an official authority such as:\r\nPassport\r\nDriver''s License\r\nProfessional Regulations Commission (PRC) ID\r\nNational Bureau of Investigation (NBI) Clearance\r\nPolice Clearance\r\nPostal ID\r\nVoter''s ID\r\nBarangay Certification\r\nGovernment Service Insurance System (GSIS) E-card\r\nSocial Security System (SSS) Card\r\nSenior Citizen Card\r\nOverseas Workers Welfare Administration (OWWA) ID\r\nOFW ID\r\nSeaman''s Book\r\nAlien Certification of Registration/Immigrant Certificate of Registration\r\nGovernment Office and GOCC ID, e.g. Armed Forces of the Philippines (AFP ID), Home Development Mutual Fund (HDMF ID)\r\nCertification from the National Council for the Welfare of Disabled Persons (NCWDP)\r\nDepartment of Social Welfare and Development Certification (DSWDC)\r\nIntegrated Bar of the Philippines ID\r\nCompany ID''s issued by private entities or institutions registered or supervised either by BSP, SEC or IC.', NULL),
(2, 'Auto Loan', 1, 'At least 21 years old but not exceeding 65 years old at the end of loan term\r\nFilipino citizen or foreigners residing in the Philippines for at least 2 years\r\nMinimum gross family income of P50,000/month\r\nStable source of income from employment or business:\r\nIf locally employed, at least 2 years with current company\r\nIf employed abroad, 2 years consecutive contract for skilled workers or 3 years consecutive contract for household workers\r\nIf self-employed, at least 2 consecutive profitable years of operation.', 'Filled out and signed application form\r\nIdentification Document:\r\nClear copy of one (1) valid ID matching your application details (e.g Passport, Drivers License, SSS, PRC, OWWA ID, OFW ID< Seamans Book)\r\nFor Foreigners, Alien Certificate of Registration with Work Permit\r\nIncome documents:\r\nIf Locally Employed\r\nLatest Income Tax Return, or BIR Form 2316, or latest payslip\r\nCertificate of Employment with Salary\r\nAdditional for Foreigners: current employment contract\r\nIf Employed Abroad\r\nProof of Remittance for the last 3 months\r\nLatest Crew Contract (for Seafarers)\r\nCertificate of Employment with Salary, or Employment Contract*\r\n* Consularized if no proof of remittance is submitted\r\nIf Self-Employed\r\nPhotocopy of Audited Financial Statements for the last 2 years, with latest ITR\r\nBank Statements of Photocopy of Passbook for the last 3 months\r\nCertificate of Business Registration\r\nProof of other income (if any)', NULL),
(3, 'Home Loan', 1, 'At least 21 years old but not exceeding 65 years at the end of loan term\r\nFilipino citizens or Foreign nationals           \r\nMinimum gross family income of P50,000/month (or its equivalent in USD)\r\nStable source of income from employment or business\r\nIf locally employed, at least 2 years with current company\r\nIf employed abroad\r\n2 years consecutive contract for skilled workers or 3 years consecutive contract for household workers\r\nAssignment of Attorney-in-Fact as Loan Administrator if not in the Philippines at the time of application. Click here for the standard SPA form.\r\nIf self-employed, at least 2 consecutive profitable years of operation', ' Basic Documents\r\nFilled-out and signed application form\r\nClear copy of one (1) valid ID matching application details\r\nMarriage contract (if applicable)\r\n \r\n? Income Documents\r\nIf employed\r\nCertificate of Employment (COE) with Salary\r\nIf employed abroad\r\nProof of Remittance for the last 3 months\r\nLatest Crew Contract (for seafarers)\r\nCertificate of Employment with Salary of Employment Contract (Consularized, if no proof of remittance is submitted)\r\nIf self-employed\r\nPhotocopy of Audited Financial Statements for the last 2 years with latest ITR\r\nBank Statements or Photocopy of Passbook for the last 3 months\r\nCertificate of Business Registration with DTI\r\nBusiness Background / Company Profile\r\nProof of other income, if any\r\n \r\n? List of Acceptable Visas for Foreign nationals (for submission, whichever is applicable)\r\nQuota or Preference Immigrant Visa (Section 13 of Philippine Immigration Act)\r\nNon-Quota Immigration Visa such as:\r\nAlien Spouse of a Filipino citizen (Section 13A Visa)\r\nChild born outside of the Philippines to a Mother holding Section 13A Visa\r\nChild born in the Philippines to a Mother granted Section13A Visa\r\nNatural-born Filipinos married to an Alien (Section 13D)\r\nReturning Resident (Section 13E)\r\nNatural-born Filipinos naturalized by a foreign country (Section  13G)\r\nWorking Visa issued to Embassy Officials\r\nPhotocopy of Special Retiree''s Resident Visa (SRRV) or Quota/Preference Immigrant Visa\r\nPermanent Resident Status and working Visa granted by Subic Bay Metropolitan Authority (SBMA)\r\n \r\n? Collateral Documents\r\nPhotocopy of TCT / CCT\r\nPhotocopy of Tax Declaration\r\nIf Construction Loan\r\nBuilding / Floor Plan of proposed improvement\r\nBill of materials\r\nSpecification of proposed finishes\r\nIf Refinancing / Loan Take Out\r\nStatement of Account from current bank and official receipts for the last three (3) months', NULL),
(4, 'SME Loan', 1, '    At least 21 years old but not exceeding 65 years old at the end of the\r\n     loan term\r\n    With stable source of income from business and/or employment\r\n          ?  If Employed, at least 2 years of continuous employment (may be\r\n              waived if rank is at least Manager level)\r\n          ?  If Professional (doctor, lawyer, etc.), at least 3 years in practice\r\n              of profession\r\n    Business is in profitable operation for at least 2 consecutive years, with\r\n     minimum annual gross sales of P1 Million        \r\n    Business is within a BDO serviceable area         ', '   Basic Documents\r\n            Filled-out and signed application form\r\n            Clear copy of one (1) valid ID matching application details, e.g.\r\n             (Passpport, Driver''s License, SSS)\r\n            Marriage Contract (if applicable) \r\n \r\n    Income Documents', NULL),
